  {
   "cell_type": "code",
   "execution_count": 131,
   "metadata": {
    "tags": []
   },
   "outputs": [],
   "source": [
    "def load_labels(label_path):\n",
    "    with open(label_path.numpy(), 'r', encoding=\"utf-8\") as f:\n",
    "        label = json.load(f)\n",
    "\n",
    "    label_class = label.get('class', 0)\n",
    "    bbox = label.get('bbox', [0.0, 0.0, 0.0, 0.0])\n",
    "\n",
    "    return [label_class], bbox\n"
   ]
  },
